import React from 'react'
import "./Home.scss"

const Card = ({ img }) => {
  return <img className='card' src={img} alt="cover" />;
};


const Row = ({ title}) => {
  return (
    <div className='row'>
      <h1>{title}</h1>
    <div>
        <Card img={"https://blogger.googleusercontent.com/img/b/R29vZ2xl/AVvXsEh_0NwlZakCVYIqSDM6cwzCzD4B3LnhZ8oXCIRpolRXvjiFcpYfW7axfBk-D4lCWrWpg8843qp7phBxFQHhnh1iitx07YFjBS1s1RX8FkqEqRLCVMQRy7JnhZRdrXxWv4ci96XLw2wc_mfYIMAlkSYofNBIVZVr-Qo5_Bn5_hS8Ma4JFkeRYeM0F_ouAw/s1600/HDgallery%20RRR%20in%20Theatres%20%281%29.jpg"} />

    </div>

    </div>
  );
};


const Home = () => {
  return (
   <section className='home'>
    <div className="banner"></div>

    <Row title={"Popular on Netflix " } />
    

   </section>
  )
}

export default Home
